// pages/medicalInfo/index.js
Page({

  /**
   * 页面的初始数据
   */
  data: {
    list: {
      name:'阿莫西林',
      adverse_reactions:"国家卫生部门规定，使用阿莫西林前必须进行青霉素皮肤试验，阳性反应者禁用",
      img:'data:image/jpeg;base64,',
      usage:'抗生素类药。阿莫西林杀菌作用强，穿透细胞壁的能力也强。是目前应用较为广泛的口服青霉素之一，其制剂有胶囊、片剂、颗粒剂、分散片等等。'
    },
    loading: true
  },
  send: function(){
    this.setData({
      loading:false
    });
  },

  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function (options) {
    let that = this;
    wx.request({
      url: 'https://wuwei.soft.360.cn/feiYang/getDrugs',
      data: {
        drugid: options.id
      },
      method: 'GET',
      success: function (res) {
        that.setData({
          list:res.data.data[0]
        });
        console.log(that.data.list);
      },
      fail: function (res) {
        console.log('submit fail');
      },
      complete: function (res) {
        console.log('submit complete');
      }
    })
  },

  /**
   * 生命周期函数--监听页面初次渲染完成
   */
  onReady: function () {

  },

  /**
   * 生命周期函数--监听页面显示
   */
  onShow: function () {

  },

  /**
   * 生命周期函数--监听页面隐藏
   */
  onHide: function () {

  },

  /**
   * 生命周期函数--监听页面卸载
   */
  onUnload: function () {

  },

  /**
   * 页面相关事件处理函数--监听用户下拉动作
   */
  onPullDownRefresh: function () {

  },

  /**
   * 页面上拉触底事件的处理函数
   */
  onReachBottom: function () {

  },

  /**
   * 用户点击右上角分享
   */
  onShareAppMessage: function () {

  }
})